import React from 'react';

class ProductRow extends React.Component {
  render() {
    const { thumbnail, price, title } = this.props.products;
    return (
      <div>
        <img src={thumbnail} alt={title} />
        <span>{title}</span>
        <span>{`R$ ${price.toFixed(2)}`}</span>
      </div>
    );
  }
}

export default ProductRow;
